import React from "react";
import "./Overlay.css";
import "./App.css";

class OverlayFlightForm extends React.Component {
    constructor(props) { 
        super(props);
    }

    render() {
        return (
            <div>
                <h1 className='header'>Add a Flight</h1>
                <button className="closeOverlay" onClick={this.props.onClose}>&times;</button>
            </div>
        );
    }
}

export default OverlayFlightForm;
